import React from 'react';
import { useHistory } from 'react-router-dom';
import GoogleButton from 'react-google-button';
import axios from 'axios';

function Login() {
  const history = useHistory();

  const handleGoogleLogin = async () => {
    try {
      // Redirect to Google authentication endpoint on your backend
      const response = await axios.get('http://localhost:5000/google');
      console.log(response.data); // Handle the response if needed
    } catch (error) {
      console.error('Error logging in with Google:', error);
    }
  };

  return (
    <div>
      <h1>Login</h1>
      <GoogleButton onClick={handleGoogleLogin}>Login with Google</GoogleButton>
    </div>
  );
}

export default Login;
